void cantoolsQtMessages::can_receive_frame_callback(const QCanBusFrame &frame) {
    cantoolsQtMessage *msg;
    uint offset = 0;
    
    msg = cantoolsQtMessages::instance().map.value(offset + frame.frameId(), nullptr);
    if (msg) msg->received(frame);
}

